import "./Footer.scss";
import React from "react";
import { useTranslation, initReactI18next } from "react-i18next";
import "../i18n";
import { GetStaerted } from "../get-started-button/GetStaerted";

export const Footer = () => {
  const { t, i18n } = useTranslation();
  return (
    <div className="footer">
      <div className="footer-wrapper">
        <div className="slogan-wrapper">
          <span className="slogan">{t("psy-comfort-org-header")}</span>
          <GetStaerted />
        </div>
        <div className="footer-info">
          <div className="footer-info-wrapper">
          <Link to="/">
            <div className="logo">
              <div className="logo-footer"></div>
            </div>
            </Link>
            <div className="nav-footer">
            <Link to="/platform">
              <div className="platform platform-footer">{t("platform")}</div>
              </Link>
              <Link to="/about-app">
              <div className="about-app about-app-footer">{t("about-app")}</div>
              </Link>
              <div className="log-in log-in-footer">{t("log-in")}</div>
              <div className="get-started get-started-footer">{t("get-started")}</div>
            </div>
            <div className="copyright">
              <span>&#169; 2020 Ergonza</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
